            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origine of the program </h3>
                <p class=""description""> 
                    International meetings are always opportunities for cultural mixing in all their diversity and speaking of cultural diversity also speaks of a
                    diversity of languages; hence the need for conference interpreting professionals to take full advantage of interculturality.
                    The professional Master's Degree in Conference Interpreting offered is part of this highly international context.
                    At once intensive and progressive, it is rigorously supervised by committed professional interpreters. This Master aims ");
            WriteLiteral(@"at the active practice of
                    the different techniques of interpretation as of the end of the studies.
                </p>
            </div>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 2. Program Objectives </h3>
                <h3 class=""smaller_heading""> II.2.1. General Objective </h3>
                <p class=""description""> 
                    The objective of the Professional Master Interpreting of Conferences is to enable us to adapt to the economic context and anticipate future
                    changes in the profession (more progressive integration, increased mobility requirements, fluctuating language needs, essential second language,
                    essential English, etc.).
                </p>

                <h3 class=""smaller_heading""> II.2.2. Specific Objectives </h3>
                <p class=""description""> 
                    <strong> Commun run with the mention </strong><br/>
                    This high");
            WriteLiteral(@"-level course in interpretation makes it possible to acquire a perfect mastery of consecutive and simultaneous interpretation techniques
                    in order to exercise this activity in the context of major conferences.
                </p>


                <h3 class=""small_heading""> II.3. Approach to the program </h3>
                <p class=""description""> 
                    The first year (M1) of Conference interpretion is mainly devoted to the acquisition of interpretation techniques (preparatory exercises,
                    consecutive interpreting and note-taking techniques, sight translation, liaison interpretation) from various media in different fields. various.
                    It also helps to better understand the profession of interpreter.
                    In M2, it prepares directly for the exercise of the profession. The courses are dedicated to learning and strengthening the different techniques
                    used in the profession. Internships and silent b");
            WriteLiteral(@"ooths make it possible to concretise the lessons on the ground. Seminars on professional realities
                    and simulated conferences are organized in a fully equipped room with standards for conference interpreting.
                </p>

            </div>

        </figure>

